import React, { useState } from 'react';
import axios from 'axios';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { useNavigate } from 'react-router-dom'; // Updated import
import './LoanForm.css'; // Ensure this path is correct

const LoanForm = () => {
  const [formData, setFormData] = useState({
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: '',
    Previous_Salary: '',
    Owns_House: '',
    Rent_Amount: '',
    Grocery_Expense: '',
    Current_EMIs: '',
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Credit_Score: '',
    Number_of_Credit_Cards: '',
    Total_Credit_Limit: '',
    Number_of_Loans: '',
    Employment_Duration: '',
    Job_Title: '',
    Bonuses_Allowances: '',
    Savings: '',
    Investments: '',
    Monthly_Expenses: '',
    Age: '',
    Education_Level: '',
    Marital_Status: '',
    Dependents: '',
    Loan_Purpose: '',
    Mall_Visits_Per_Month: '',
    Mall_Spend_Average: ''
  });

  const bankOptions = [
    'State Bank of India',
    'HDFC Bank',
    'ICICI Bank',
    'Axis Bank',
    'Kotak Mahindra Bank',
    'Bank of Baroda',
    'Punjab National Bank',
    'Canara Bank',
    'Union Bank of India',
    'Indian Bank',
    'IndusInd Bank',
    'IDFC FIRST Bank',
    'Bandhan Bank',
    'Yes Bank',
    'South Indian Bank',
    'Ujjivan Small Finance Bank',
    'RBL Bank',
    'Federal Bank',
    'Lakshmi Vilas Bank',
    'Jammu & Kashmir Bank',
    'Others'
  ];

  const jobTitleOptions = [
    'Software Engineer',
    'Data Analyst',
    'Product Manager',
    'Financial Analyst',
    'Marketing Manager',
    'Sales Executive',
    'HR Manager',
    'Consultant',
    'Graphic Designer',
    'Project Manager',
    'Business Analyst',
    'Operations Manager',
    'Customer Service Executive',
    'Accountant',
    'Content Writer',
    'Web Developer',
    'UX/UI Designer',
    'Network Engineer',
    'Digital Marketer',
    'Administrative Assistant',
    'Research Scientist',
    'Others'
  ];

  const navigate = useNavigate(); // Updated hook

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      // Clear Rent_Amount if Owns_House is updated to "Yes"
      if (name === 'Owns_House' && value === 'Yes') {
        return {
          ...prevFormData,
          [name]: value,
          Rent_Amount: '' // Clear Rent_Amount when Owns_House is "Yes"
        };
      }
      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const validateForm = () => {
    for (const key in formData) {
      if (formData[key] === '') {
        return false;
      }
    }
    return true;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!validateForm()) {
      toast.error('Please check fields again');
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', formData);
      console.log('Prediction Results:', response.data);
      toast.success('Loan application submitted successfully!');
      navigate('/ss'); // Redirect to a success page or desired route
    } catch (error) {
      console.error('Error making prediction:', error.response ? error.response.data : error.message);
      toast.error('An error occurred while submitting the application.');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="form-all">
      <ToastContainer />
      {/* Personal Information Section */}
      <div className="form-section">
        <h2>Personal Information</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Full Name
              <input
                type="text"
                name="Full_Name"
                value={formData.Full_Name}
                onChange={handleChange}
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Address
              <input
                type="text"
                name="Address"
                value={formData.Address}
                onChange={handleChange}
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              PAN Number
              <input
                type="text"
                name="PAN_Number"
                value={formData.PAN_Number}
                onChange={handleChange}
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Age
              <input
                type="number"
                name="Age"
                value={formData.Age}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Education Level
              <select
                name="Education_Level"
                value={formData.Education_Level}
                onChange={handleChange}
                className="form-dropdown"
              >
                <option value="">Select</option>
                <option value="Graduate">Graduate</option>
                <option value="PostGraduate">PostGraduate</option>
                <option value="PhD">PhD</option>
              </select>
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Marital Status
              <select
                name="Marital_Status"
                value={formData.Marital_Status}
                onChange={handleChange}
                className="form-dropdown"
              >
                <option value="">Select</option>
                <option value="Single">Single</option>
                <option value="Married">Married</option>
                <option value="Widowed">Widowed</option>
                <option value="Divorced">Divorced</option>
              </select>
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Dependents
              <input
                type="number"
                name="Dependents"
                value={formData.Dependents}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Loan Purpose
              <select
                name="Loan_Purpose"
                value={formData.Loan_Purpose}
                onChange={handleChange}
                className="form-dropdown"
              >
                <option value="">Select</option>
                <option value="Home Improvement">Home Improvement</option>
                <option value="Education">Education</option>
                <option value="Medical">Medical</option>
                <option value="Other">Other</option>
              </select>
            </label>
          </div>
        </div>
      </div>

      {/* Financial Information Section */}
      <div className="form-section">
        <h2>Financial Information</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Current Salary
              <input
                type="number"
                name="Current_Salary"
                value={formData.Current_Salary}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Previous Salary
              <input
                type="number"
                name="Previous_Salary"
                value={formData.Previous_Salary}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Owns House
              <select
                name="Owns_House"
                value={formData.Owns_House}
                onChange={handleChange}
                className="form-dropdown"
              >
                <option value="">Select</option>
                <option value="Yes">Yes</option>
                <option value="No">No</option>
              </select>
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Rent Amount
              <input
                type="number"
                name="Rent_Amount"
                value={formData.Rent_Amount}
                onChange={handleChange}
                min="0"
                className="form-textbox"
                disabled={formData.Owns_House === 'Yes'} // Disable if Owns_House is Yes
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Monthly Grocery Expense
              <input
                type="number"
                name="Grocery_Expense"
                value={formData.Grocery_Expense}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Current EMIs
              <input
                type="number"
                name="Current_EMIs"
                value={formData.Current_EMIs}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Savings
              <input
                type="number"
                name="Savings"
                value={formData.Savings}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Investments
              <input
                type="number"
                name="Investments"
                value={formData.Investments}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Monthly Expenses
              <input
                type="number"
                name="Monthly_Expenses"
                value={formData.Monthly_Expenses}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Bonuses & Allowances
              <input
                type="number"
                name="Bonuses_Allowances"
                value={formData.Bonuses_Allowances}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
      </div>

      {/* Job Details Section */}
      <div className="form-section">
        <h2>Job Details</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Company Name
              <input
                type="text"
                name="Company_Name"
                value={formData.Company_Name}
                onChange={handleChange}
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Job Title
              <select
                name="Job_Title"
                value={formData.Job_Title}
                onChange={handleChange}
                className="form-dropdown"
              >
                <option value="">Select</option>
                {jobTitleOptions.map((title, index) => (
                  <option key={index} value={title}>
                    {title}
                  </option>
                ))}
              </select>
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Employment Duration (in years)
              <input
                type="number"
                name="Employment_Duration"
                value={formData.Employment_Duration}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Date of Previous Salary Hike
              <input
                type="date"
                name="Date_Previous_Hike"
                value={formData.Date_Previous_Hike}
                onChange={handleChange}
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Date of Next Salary Hike
              <input
                type="date"
                name="Date_Next_Hike"
                value={formData.Date_Next_Hike}
                onChange={handleChange}
                className="form-textbox"
              />
            </label>
          </div>
        </div>
      </div>

      {/* Credit and Loans Section */}
      <div className="form-section">
        <h2>Credit and Loans</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Bank Name
              <select
                name="Bank_Name"
                value={formData.Bank_Name}
                onChange={handleChange}
                className="form-dropdown"
              >
                <option value="">Select</option>
                {bankOptions.map((bank, index) => (
                  <option key={index} value={bank}>
                    {bank}
                  </option>
                ))}
              </select>
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Credit Score
              <input
                type="number"
                name="Credit_Score"
                value={formData.Credit_Score}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Number of Credit Cards
              <input
                type="number"
                name="Number_of_Credit_Cards"
                value={formData.Number_of_Credit_Cards}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Total Credit Limit
              <input
                type="number"
                name="Total_Credit_Limit"
                value={formData.Total_Credit_Limit}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Number of Loans
              <input
                type="number"
                name="Number_of_Loans"
                value={formData.Number_of_Loans}
                onChange={handleChange}
                min="0"
                className="form-textbox"
              />
            </label>
          </div>
        </div>
      </div>

      {/* Submit Button */}
      <div className="form-section">
        <button type="submit" className="form-submit-button">Submit</button>
      </div>
    </form>
  );
};

export default LoanForm;
















